import Link from 'next/link';

const links = [
  { href: '/about', label: 'About'},
  { href: '/signup', label: 'Sign Up' },
  { href: 'login', label: 'Login' }
].map(link => {
  link.key = `nav-link-${link.href}-${link.label}`
  return link
})

const Nav = () => (
  <nav>
    <ul>
      <li>
        <Link href='/'>
          <a>AL-Bum</a>
        </Link>
      </li>
      {links.map(({ key, href, label }) => (
        <li key={key}>
          <a href={href}>{label}</a>
        </li>
      ))}
    </ul>

    <style jsx>{`
      :global(body) {
        margin: 0;
        font-family: sans-serif;
      }
      nav {
        text-align: center;
        background-color: #333;
        margin-top: 0;
        height: 50px;
      }
      ul {
        display: flex;
        justify-content: space-between;
      }
      nav > ul {
        padding: 4px 16px;
      }
      li {
        display: flex;
        padding: 6px 8px;
      }
      nav a {
        color: #f2f2f2;
        text-decoration: none;
        font-size: 13px;
      }
      nav a:hover {
        color: #ffffff;
        font-weight: bold;
      }
      `}
    </style>
  </nav>
);

export default Nav;
